import React from 'react';
import 'Hamburger.scss';

const Hamburger = () => {
    return(
        <div className="hamburger">
            <div className="hamburger-top">1</div>
            <div className="hamburger-middle">2</div>
            <div className="hamburger-bottom">3</div>
        </div>
    )
}

export default Hamburger;
